import React from 'react';
import { NavLink, useLocation } from 'react-router-dom';

const adminLinks = [
  { path: '/admin', label: 'Dashboard', icon: <span role="img" aria-label="dashboard">üìä</span> },
  { path: '/admin/announcements', label: 'Announcements', icon: <span role="img" aria-label="announcements">üì¢</span> },
  { path: '/admin/book-room', label: 'Book Room', icon: <span role="img" aria-label="book room">üè¢</span> },
  { path: '/admin/my-bookings', label: 'My Bookings', icon: <span role="img" aria-label="my bookings">üìã</span> },
  { path: '/admin/view-bookings', label: 'All Bookings', icon: <span role="img" aria-label="bookings">üìë</span> },
  { path: '/admin/calendar', label: 'Calendar', icon: <span role="img" aria-label="calendar">üóìÔ∏è</span> },
  { path: '/admin/view-issues', label: 'View Issues', icon: <span role="img" aria-label="issues">üõ†Ô∏è</span> },
  { path: '/admin/add-pool', label: 'Add Pool', icon: <span role="img" aria-label="add pool">üó≥Ô∏è</span> },
  { path: '/change-password', label: 'Change Password', icon: <span role="img" aria-label="change password">üîë</span> },
  { path: '/profile', label: 'Profile', icon: 'üë§' },
  { path: '/settings', label: 'Settings', icon: <span role="img" aria-label="settings">‚öôÔ∏è</span> },
];

const SIDEBAR_WIDTH = 240;

const Sidebar = () => {
  const location = useLocation();

  return (
    <aside
      style={{
        width: SIDEBAR_WIDTH,
        background: '#111',
        height: 'calc(100vh - 72px)',
        color: '#fff',
        padding: 0,
        position: 'fixed',
        top: '72px',
        left: 0,
        boxShadow: '2px 0 12px rgba(0,0,0,0.13)',
        display: 'flex',
        flexDirection: 'column',
        zIndex: 1100
      }}
    >
      <div style={{
        height: '64px',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'flex-start',
        paddingLeft: '24px',
        background: '#111',
        borderBottom: '1px solid #222'
      }}>
        <span style={{
          fontSize: '1.7rem',
          color: '#00bfff',
          fontWeight: 900,
          letterSpacing: '1.5px',
          marginTop: '2px'
        }}>
          Admin
        </span>
      </div>
      {/* Scrollable menu */}
      <div
        style={{
          flex: 1,
          overflowY: 'auto',
          scrollbarWidth: 'none', // Firefox
          msOverflowStyle: 'none', // IE 10+
        }}
      >
        <style>
          {`
            /* Hide scrollbar for Chrome, Safari and Opera */
            div[style*="overflow-y: auto"]::-webkit-scrollbar {
              display: none;
            }
          `}
        </style>
        <ul style={{ listStyle: 'none', padding: '28px 0 0 0', margin: 0 }}>
          {adminLinks.map(({ path, label, icon }) => {
            // FIXED: Custom active logic for dashboard
            const isActive = path === '/admin' 
              ? location.pathname === '/admin'
              : location.pathname === path;

            return (
              <li key={path} style={{ marginBottom: '14px' }}>
                <NavLink
                  to={path}
                  style={{
                    display: 'flex',
                    alignItems: 'center',
                    color: isActive ? '#00bfff' : '#e3e9f7',
                    textDecoration: 'none',
                    fontWeight: isActive ? 700 : 500,
                    fontSize: '1.18rem',
                    padding: '14px 24px',
                    borderRadius: '8px 0 0 8px',
                    background: isActive ? 'rgba(0,191,255,0.13)' : 'none',
                    boxShadow: isActive ? '0 2px 12px rgba(0,191,255,0.08)' : 'none',
                    transition: 'background 0.18s, color 0.18s, box-shadow 0.18s'
                  }}
                >
                  <span style={{ marginRight: '16px', fontSize: '1.4em' }}>{icon}</span>
                  {label}
                </NavLink>
              </li>
            );
          })}
        </ul>
      </div>
      {/* Copyright always at bottom */}
      <div style={{
        padding: '22px 0 14px 0',
        textAlign: 'center',
        fontSize: '1rem',
        color: '#bbdefb',
        borderTop: '1px solid #222'
      }}>
        &copy; {new Date().getFullYear()} INCOR
      </div>
    </aside>
  );
};

export default Sidebar;
